DROP TABLE IF EXISTS `dataset`;

CREATE TABLE `dataset` (
  `service_type`    ENUM("walking", "grooming", "boarding", "sitting") NOT NULL,
  `service_start`   TIMESTAMP NOT NULL,
  `service_stop`    TIMESTAMP NOT NULL,
  `dog_name`        VARCHAR(50) NOT NULL,
  `dog_age`         TINYINT UNSIGNED NOT NULL,
  `dog_weight`      TINYINT UNSIGNED NOT NULL,
  `owner_name`      VARCHAR(50) NOT NULL,
  `owner_phone`     CHAR(10) NOT NULL,
  `owner_lat`       DOUBLE NOT NULL,
  `owner_lon`       DOUBLE NOT NULL,
  `worker_name`     VARCHAR(50) NOT NULL,
  `worker_phone`    CHAR(10) NOT NULL,
  `worker_lat`      DOUBLE NOT NULL,
  `worker_lon`      DOUBLE NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DELIMITER ;;

DROP FUNCTION IF EXISTS `gps_distance`;;
CREATE FUNCTION `gps_distance`(lat1 FLOAT, lon1 FLOAT, lat2 FLOAT, lon2 FLOAT) RETURNS float
BEGIN
    DECLARE dlon, dlat, a FLOAT;

    SET lat1 = RADIANS(lat1);
    SET lat2 = RADIANS(lat2);

    SET lon1 = RADIANS(lon1);
    SET lon2 = RADIANS(lon2);

    SET dlon = lon2 - lon1;
    SET dlat = lat2 - lat1;

    SET a = POW(SIN(dlat/2), 2) + COS(lat1) * COS(lat2) * POW(SIN(dlon/2), 2);

    RETURN 6373 * 2 * ATAN2(SQRT(a), SQRT(1-a)); # kilometers
END;;

DELIMITER ;
